●印刷速度（Ａ４）／モノクロ A4：35枚／分、両面印刷：A4（2ページ：両面表裏1枚）35ページ／分<BR>●印刷解像度／2400dpi相当<BR>●給紙容量／[標準]カセット：250枚×1段、手差しトレイ：100枚、[オプション給紙]550枚×3段まで増設可能、[最大給紙枚数]2000枚<BR>●最大印字用紙サイズ／給紙カセット：定型A3／定形外ユーザー定義サイズ(幅297.0mm×長さ431.8mm)、手差しトレイ：定型外(幅312.0mm×長さ470.0mm)、LIPS LXのみ(幅297.0mm×長さ1200.0mm)<BR>●対応用紙サイズ／給紙カセット：A3／B4／A4／B5／A5／レジャー／リーガル／レター／エグゼクティブ／ユーザー定義サイズ（幅 210.0～297.0mm×長さ 148.0～431.8mm） （オプションカセットでは幅100.0～297.0mm、長さ182.0～431.8mmまで対応可能）手差しトレイ：幅 76.2～312.0mm×長さ 127.0～470.0mm、幅 210.0～297.0mm×長さ 470.1～1200.0mm（LIPS LXのみ）、質量：カセット・60～120g/m2、手差しトレイ・60～199g/m2<BR>●対応用紙種類／普通紙、厚紙、再生紙、郵便ハガキ、往復ハガキ、ラベル紙、OHPフィルム、 封筒（洋形長3号／長形3号／角形2号（ハート社製レーザービームプリンター用封筒推奨））、4面ハガキ<BR>●両面印刷／標準対応（A3／B4／A4／A4R／B5／A5／レジャー／リーガル／レター／レターR／エグゼクティブ）<BR>●ネットワーク対応／有線LAN<BR>●インターフェース／USB 2.0 Hi-Speed×1、USB 2.0 Host×1、1000Base-T／100Base-TX／10Base-T<BR>●対応ＯＳ／Windows XP（32bit／64bit）／Windows Server 2003（32bit／64bit）／Windows Server 2008（32bit／64bit）／Windows Server 2008 R2（64bit）／Windows Server 2012（64bit）／Windows Server 2012 R2（64bit）／Windows Vista（32bit／<br>●メーカー／キヤノン<br>●型番／8261B002<br>●JANコード／4960999994499<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<br><br>※メーカー都合によりパッケージ・仕様等が予告なく変更される場合がございます。ご了承ください。<br><br>本商品は自社サイトでも販売しているため、ご注文のタイミングにより、発送までにお時間をいただいたり、やむをえずキャンセルさせていただく場合がございます。<br><br>※沖縄へのお届けは別途1620円(税込)の送料がかかります。<br><br><font color=red>※本商品は代引きでのお支払いはできません。予めご了承ください。</font><p>お買い物マラソン等イベント開催中は、ご注文の集中により発送手続き、お問い合わせの回答にお時間をいただく場合がございます。ご了承ください。</p>

